(17, 1, 1, 'Dziurkacze i zszywacze', '<p><span style=\"color:#666;font-family:Helvetica, Arial, Roboto, sans-serif;font-size:14px;text-align:justify;\">Dziurkacze i zszywacze to akcesoria, których nie może zabraknąć w żadnym biurze czy firmie. Dziurkacze umożliwiają wycinanie otworów w kartach papieru, a co za tym idzie ułatwiają ich przechowywanie w segregatorach oraz skoroszytach. Z kolei zszywacze pozwalają nam na swobodne łączenie dokumentów w jedną, spójną całość. Do większych biur i firm przydatne będą większe akcesoria wykonane z cięższych materiałów, natomiast w domach i na biurkach lepiej sprawdzą się mniejsze, lekkie i łatwo przenośne modele.</span></p>', 'dziurkacze_i_zszywacze', '', '', ''),
