INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', 'Nasze warunki i zasady dostarczenia zamówienia', '', '<h2 style=\"font-size:18px;font-weight:bold;\">Wysyłka Twojego zamówienia</h2>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:Verdana, \'sans-serif\';color:#000000;\">Paczki są zwykle dostarczane w ciągu 1-7 dni od otrzymania potwierdzenia zapłaty w zależności od wyboru metody dostawy.</span></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:Verdana, \'sans-serif\';color:#000000;\">Koszty wysyłki są zależne zarówno od metody dostawy jak i wagi zamówienia. Zachęcamy do grupowania przedmiotów w jednym zamówieniu. Nie możemy pogrupować dwóch przedmiotów zamówionych odrębnie i koszty wysyłki zostaną zaliczone oddzielnie dla każdego. Twoja paczka będzie dostarczona na Twoje własne ryzyko, ale stosujemy wysoką ostrożność przy delikatnych przedmiotach.</span></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:Verdana, \'sans-serif\';color:#000000;\">Paczki są starannie zapakowane i Twoje produkty są dobrze zabezpieczone.</span></p>\n<h3 style=\"font-size:18px;font-weight:bold;\">Darmowa dostawa dla zamówień za ponad 200 zł!</h3>', 'dostawa'),
(2, 1, 1, 'Informacje Prawne', 'informacje prawne', '', '<h2 style=\"font-size:18px;font-weight:bold;\">Twórcy</h2>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-family:Verdana, sans-serif;\"><span style=\"font-size:16px;\">Sklep internetowy stworzony przez firmę <strong>IT4All.</strong></span></span></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;font-size:16px;\">Ta strona została wykonana z użyciem <a href=\"http://www.prestashop.com\" style=\"font-size:16px;font-weight:400;\">PrestaShop</a><span style=\"font-size:11px;\">™.</span></p>', 'informacje-prawne'),
(3, 1, 1, 'Regulamin sklepu', 'Regulamin sklepu', '', '<h2>Your terms and conditions of use</h2>\n<h3>Rule 1</h3>\n<p>Here is the rule 1 content</p>\n<h3>Rule 2</h3>\n<p>Here is the rule 2 content</p>\n<h3>Rule 3</h3>\n<p>Here is the rule 3 content</p>', 'regulamin-sklepu'),
(4, 1, 1, 'O nas', 'Dowiedz się więcej o nas', '', '<h2 style=\"font-size:18px;font-weight:bold;\">Czym się zajmujemy?</h2>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:Verdana, \'sans-serif\';color:#000000;\">Nasza firma zajmuje się sprzedażą wszystkiego, co potrzebujesz w swoim biurze. Realizujemy zamówienia najszybciej, jak to tylko możliwe, abyś mógł korzystać z potrzebnych produktów niemalże od razu.</span></p>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"></p>\n<h2 style=\"font-size:18px;font-weight:bold;\">Co sprzedajemy?</h2>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:Verdana, \'sans-serif\';color:#000000;\">W naszej ofercie znajdziesz artykuły papiernicze, piśmiennicze, biurowe, szkolne, a nawet spożywcze. Możesz też zakupić urządzenia biurowe, produkty ułatwiające organizację dokumentów, tusze i tonery, a także wszystko, co potrzebujesz do szykowania własnych wysyłek.</span></p>\n<h3 style=\"font-size:18px;font-weight:bold;\">Skorzystaj z naszej bogatej oferty już dziś!</h3>', 'o-nas'),
(5, 1, 1, 'Płatności', 'płatności', 'paypal,mastercard,visa,ssl,płatność,bezpieczne', '<h2 style=\"font-size:18px;font-weight:bold;\">Formy płatności</h2>\n<p class=\"MsoNormal\" style=\"line-height:normal;\"><span style=\"font-size:12pt;font-family:Verdana, \'sans-serif\';color:#000000;\">Akceptujemy internetowe przelewy oraz płatność gotówką.</span></p>', 'platnosc');
