(422, NULL, NULL, 'REVWS_CHECK_VERSION', '{\"ts\":1543063465863,\"version\":\"1.0.22\",\"notes\":\"\\n### Bug fixes and support for review types\\n\\nThis release improve stability of revws module by fixing few bugs. But it also changes underlying database structure to support different types of reviews.\\n\\n#### Bug fixes:\\n\\n- issue [#74](https:\\/\\/github.com\\/getdatakick\\/revws\\/issues\\/74) - Can\'t create review from backend when non-global criterion exists bug\\n- issue [#75](https:\\/\\/github.com\\/getdatakick\\/revws\\/issues\\/75) - Emails send when importing reviews bug\\n- fixed detection of missing emails\\n- fixed bug in sorting review list by product name\\n\",\"paid\":\"### Do you need more reviews?\\n\\nI offer **premium version** of revws module that can help you with this task. You can set it up to automatically **send\\nemails** to your customers asking them to review products they have recently bought.\\n\\nYou can upgrade to **premium version** for only **39.99 EUR**. This price includes **all future updates** of the module.\\n\\nThere are some interesting features in my backlog, mainly **rewards for review**. You can give your customers an incentive to write review by offering discount coupon in return.\\n\"}', '2018-11-05 22:41:58', '2018-11-24 13:44:25'),
